import React from 'react';
import PersonIcon from '@mui/icons-material/Person';

import './Header.css';

function Header(){
    return (
        <div className="header">
            <h5>I'm the Header</h5>
            <PersonIcon fontSize="large" className="header__icon" />
        </div>
    )
}

export default Header;
